import React from 'react';

const Navbar = ({ onProfileClick }) => {
  return (
    <div className="navbar">
      <div className="logo">
        <a href="/main">Lost & Found</a>
      </div>
      <div className="links">
        <a href="/main">Home</a>
        <a href="#about-us">About Us</a>
        <a href="#contact-us">Contact Us</a>
        <button onClick={onProfileClick} style={{ cursor: 'pointer' }}>
          Profile
        </button>
      </div>
    </div>
  );
};

export default Navbar;
